import React from "react";

const Card = ({ children, className = "" }) => {
  return (
    <div
      className={`rounded-2xl shadow-sm border p-6 transition-colors ${className}`}
      style={{
        background: "var(--surface)",
        borderColor: "var(--border)",
        color: "var(--text)"
      }}
    >
      {children}
    </div>
  );
};

export default Card;
